object Solution {
    def minOperations(nums1: Array[Int], nums2: Array[Int]): Int = {
        val n = nums1.length
        var ops = 0

        val maxIndex1 = nums1.indices.maxBy(nums1)
        val maxIndex2 = nums2.indices.maxBy(nums2)

        if (nums1(maxIndex1) > nums2(maxIndex1)) {
            val temp = nums1(maxIndex1)
            nums1(maxIndex1) = nums2(maxIndex1)
            nums2(maxIndex1) = temp
            ops += 1
        }

        if (nums2(maxIndex2) > nums1(maxIndex2)) {
            val temp = nums1(maxIndex2)
            nums1(maxIndex2) = nums2(maxIndex2)
            nums2(maxIndex2) = temp
            ops += 1
        }

        if (nums1(n - 1) == nums1.max && nums2(n - 1) == nums2.max) ops else -1
    }
}
